function HomeBody() {
  return (
    <div>
      <img
        className="rounded mx-auto d-block"
        src="./JoelHiltonHeadshot.jpg"
        height="400"
      />
      <p className="text-center">
        {' '}
        This site displays the movies curated by Joel Hilton and his impeccable
        taste.
      </p>
    </div>
  );
}

export default HomeBody;
